  /// SLAB_ARENA_ flags for mmap() and madvise() calls.
  @ffi.Int()
  external int flags;
}

/// A very primitive implementation of lock-free
/// LIFO (last in first out, AKA stack, AKA single-linked
/// list with head-only add and remove).
